import React, { useState } from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import axios from 'axios';
import './Pagesstyle.css';
import Leftbar from '../component/Leftbar';

export default function Profile() {
  const [isEditing, setIsEditing] = useState(false);
  const [username, setUsername] = useState(localStorage.getItem('username'));
  const [bio, setBio] = useState(localStorage.getItem('bio'));
  const avatar = localStorage.getItem('avatar');
  const token = localStorage.getItem('token');
  const [newUsername, setNewUsername] = useState(username);
  const [newBio, setNewBio] = useState(bio);

  const updateUserProfile = () => {
    // Implement your PUT request to update the user's profile with newUsername and newBio.
    // Also, update the state with the new values.
    setIsEditing(false); // Hide the form after submission.
  };

  const itemData = [
    // Your item data
  ];

  const [value, setValue] = React.useState('1');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div id="profile">
      <Leftbar></Leftbar>
      <div id="top">
        <Avatar id="img" sx={{ width: 160, height: 160 }} src={avatar} />

        <h2 id="name">{username}</h2>
        {isEditing ? (
          <div>
            <input
              type="text"
              placeholder="New Username"
              value={newUsername}
              onChange={(e) => setNewUsername(e.target.value)}
            />
            <input
              type="text"
              placeholder="New Bio"
              value={newBio}
              onChange={(e) => setNewBio(e.target.value)}
            />
          </div>
        ) : (
          <div>
            <Button id="butt" variant="contained" onClick={() => setIsEditing(true)}>
              Edit Profile
            </Button>
            <Button id="butt" variant="contained">
              View actions
            </Button>
          </div>
        )}
        <SettingsOutlinedIcon />

        <div id="stats">
          <p id="p">5 Posts</p>
          <p id="p">211 followers</p>
          <p id="p">300 Following</p>
        </div>
        <div id="bio">
          {isEditing ? (
            <div>
              <Button variant="contained" onClick={updateUserProfile}>
                Save
              </Button>
            </div>
          ) : null}
          <p id="p">{newUsername}</p>
          <p id="p">{newBio}</p>
        </div>
      </div>
      <div className="profile_posts">
        <Box sx={{ width: '100%' }}>
          <TabContext value={value}>
            <TabList onChange={handleChange}>
              <Tab value="1" label="Posts" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
              <Tab value="2" label="Reels" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
              <Tab value="3" label="Tagged" sx={{ color: 'white', paddingRight: 10, paddingLeft: 10 }} />
            </TabList>
            <TabPanel value="1">
              <ImageList sx={{ width: 750, height: 380, marginLeft: -10 }} cols={3} rowHeight={300}>
                {itemData.map((item) => (
                  <ImageListItem key={item.img} sx={{ marginLeft: 2, marginBottom: 3 }}>
                    <img srcSet={item.img} src={item.img} alt={item.title} />
                  </ImageListItem>
                ))}
              </ImageList>
            </TabPanel>
            <TabPanel value="2">
              <div className="prog">
                <br />
                <p>There are no reels</p>
              </div>
            </TabPanel>
            <TabPanel value="3">
              <div className="prog">
                <br />
                <p>There are no tagged posts</p>
              </div>
            </TabPanel>
          </TabContext>
        </Box>
      </div>
    </div>
  );
}
